class Solution:
    def maxProduct(self, nums) -> int:
        max_product= m=s=nums[0]
        
        for i in range(1,len(nums)):
            m,s = max(nums[i],m*nums[i],s*nums[i]), min(nums[i],m*nums[i],s*nums[i])
            max_product = max(max_product,m)
        
        return max_product
